  false,\n\t\"url\": null,\n\t\"notes\": \"This part of DS 781 presents data for the
  bathymetry and shaded-relief maps of Offshore Scott Creek, California. The raster
  data file is included in \"BathymetryHS_OffshoreScottCreek.zip\", which is accessible
  from http://dx.doi.org/10.5066/F7CJ8BJW. The bathymetry and shaded-relief maps of
  Offshore Scott Creek, California, were generated from bathymetry data collected
  by California State University, Monterey Bay (CSUMB), by Fugro Pelagos, and by the
  U.S. Geological Survey (USGS). Mapping was completed between 2006 and 2009, using
  a combination of 400-kHz Reson 7125 and 244-kHz Reson 8101 multibeam echosounders,
  as well as a 234-kHz SWATHplus bathymetric sidescan-sonar system. These mapping
  missions combined to collect bathymetry from about the 10-m isobath to beyond the
  3-nautical-mile limit of Californiau0092s State Waters.\",\n\t\"license_title\":
